(59, 'http://www.sharkbayte.com/Photography/2011-Daily-Photos/15280496_QJTL2X#!i=1381656376&k=5xTsnPJ&lb=1&s=A', 'July 13, 2011-These are two of the kittens from a few days ago. Their mother moved all of them to the neighbor''s house. Well that night we had a lot of rain, the next morning I found all four of the kittens back in my yard, inside a huge planter that was on it''s side and off the ground, they are protected from the rain and the sun. The mother cat just amazes me.  Jasper my pup is not happy with the situation. (194:365)Thank you all so much for all the wonderful comments and response to my picture yesterday, it was overwhelming!', 'http://www.sharkbayte.com/Photography/2011-Daily-Photos/i-5xTsnPJ/0/L/20110712-MG0024-Edit-L.jpg', 'July 13, 2011-These are two of the kittens from a few days ago. Their mother moved all of them to the neighbor''s house. Well that night we had a lot of rain, the next morning I found all four of the kittens back in my yard, inside a huge planter that was on it''s side and off the ground, they are protected from the rain and the sun. The mother cat just amazes me.  Jasper my pup is not happy with the situation. (194:365)Thank you all so much for all the wonderful comments and response to my picture yesterday, it was overwhelming!'),
(60, 'http://www.mattpilsner.com/Daily-Photos/Daily-Photos-2008/4108630_8FLxg7#!i=253292867&k=Lvsdo&lb=1&s=A', 'Feb 11, 2008   (1 of 2)Here''s Mia playing in a chair.  I had a small photo shoot with her yesterday.  She''s pretty quick, so it''s very hard to get good shots of her.  She also kept sliding off the chair, and I kept putting her back because I thought the dark chair went well with her fur.  You all must think I put the macro lens down for 2 days, but you would be wrong.  Yesterday''s and Today''s photo were taken with the Macro lens.  It''s a sweet piece of glass.There are some more cute photos of Mia HERE.I''m off today, so It will be a 2 photo day.  The second photo is ', 'http://www.mattpilsner.com/Daily-Photos/Daily-Photos-2008/IMG4619/253292867_Lvsdo-L-1.jpg', 'Feb 11, 2008   (1 of 2)Here''s Mia playing in a chair.  I had a small photo shoot with her yesterday.  She''s pretty quick, so it''s very hard to get good shots of her.  She also kept sliding off the chair, and I kept putting her back because I thought the dark chair went well with her fur.  You all must think I put the macro lens down for 2 days, but you would be wrong.  Yesterday''s and Today''s photo were taken with the Macro lens.  It''s a sweet piece of glass.There are some more cute photos of Mia HERE.I''m off today, so It will be a 2 photo day.  The second photo is '),
